import React from 'react';
import ReactDOM from 'react-dom';

class Welcome extends React.Component {
  constructor(props) {
    super(props)
  }

  componentDidMount() {}

  render() {
    return <h1>{this.props.message}</h1>
  }
}

ReactDOM.render(
  <Welcome message="my first class component"/>,
  document.getElementById('root')
);
